export default function filter(array, options) {
  const { textProperty = "", valueProperty } = options;

  let path = textProperty ? textProperty.split(".") : null;
  console.log(path);

  const filtered = options
    ? array.filter((element) => element[textProperty] === valueProperty)
    : array;

  const newfilter = options
    ? array.forEach((element) => {
        console.log(
          element["rocket.first_stage.cores[0].land_success"],
          textProperty
        );
      })
    : array;
  console.log(filtered);
  return array;
}
